package byit.aladdin.dataAnalysis.entity;

import java.util.Date;

/**
 * 日志分析实体类
 * @author tanghuabo
 */
public class LogEntity{
	/**
	 * 
	 */
	private String eventid;// 主键
	private String username;
	private String userid;
	private String systype;//操作类型
	private Date logdate;//操作时间
	private String url;//页面url
	private String menuid;
	private String menu;
	private String submenuid;
	private String submenu;
	private Integer count;
	public LogEntity() {
		super();
		// TODO Auto-generated constructor stub
	}
	public LogEntity(String eventid, String systype, Date logdate, String url, String menuid, String menu,
			String submenuid, String submenu) {
		super();
		this.eventid = eventid;
		this.systype = systype;
		this.logdate = logdate;
		this.url = url;
		this.menuid = menuid;
		this.menu = menu;
		this.submenuid = submenuid;
		this.submenu = submenu;
	}
	public String getEventid() {
		return eventid;
	}
	public void setEventid(String eventid) {
		this.eventid = eventid;
	}
	public String getSystype() {
		return systype;
	}
	public void setSystype(String systype) {
		this.systype = systype;
	}
	public Date getLogdate() {
		return logdate;
	}
	public void setLogdate(Date logdate) {
		this.logdate = logdate;
	}
	public String getUrl() {
		return url;
	}
	public void setUrl(String url) {
		this.url = url;
	}
	public String getMenuid() {
		return menuid;
	}
	public void setMenuid(String menuid) {
		this.menuid = menuid;
	}
	public String getMenu() {
		return menu;
	}
	public void setMenu(String menu) {
		this.menu = menu;
	}
	public String getSubmenuid() {
		return submenuid;
	}
	public void setSubmenuid(String submenuid) {
		this.submenuid = submenuid;
	}
	public String getSubmenu() {
		return submenu;
	}
	public void setSubmenu(String submenu) {
		this.submenu = submenu;
	}
	public Integer getCount() {
		return count;
	}
	public void setCount(Integer count) {
		this.count = count;
	}
	public String getUsername() {
		return username;
	}
	public void setUsername(String username) {
		this.username = username;
	}
	public String getUserid() {
		return userid;
	}
	public void setUserid(String userid) {
		this.userid = userid;
	}
	
}
